驚きのツルすべボディと疎水性コートを実現するプレミアムクイックワックスコート<br>
<br>
●疎水性ポリマーテクノロジーにより水をはじく強固なワックスコートを形成します。<br>
●耐熱性カルナバワックスが細かなキズを埋め、深みのある輝きを与えます。<br>
●汚れや油分等をすばやく落とします。<br>
●樹脂パーツやガラスにも使用できます。<br>
●ノーコンパウンドタイプです。<br>
●コーティング施工車にも使用できます。<br>
●適合色:オールカラー<br>
●成分:疎水性ポリマー、カルナバワックス、界面活性剤<br>
●液性:弱酸性<br>
●内容量:651ml<br>
●製品サイズ(H×W×D):273×101×58(mm)<br>
●製品重量:718g<br><style type="text/css">
