スムースエッグ リキッド<br><br>●新技術「リペアコート」によって、傷んできたガラス系プロ施工コーティング車の<br>被膜表面を修復しながら、撥水効果を実現した新発想のコーティング剤。<br><br>●洗車後の濡れたボディにスプレーして拭き取るだけで、<br>まるでゆでタマゴのようなつるつる感と強力な撥水性を得ることが出来ます。<BR><br>●プロ施工コーティングしていない車にも使用可能、<br>施工いただくことで塗装面に【つるるん被膜】を形成します。<BR><br>●ボディ以外にも、ホイール・ガラス・ヘッドライト・テールランプ・<br>バイザー・未塗装樹脂パーツ・内装にも使用できます。<br><br>●全塗装色対応。<br><br><br>内容量：250ml<br><br>メーカー：ソフト99<br>品番：W-510<style type="text/css">
